import React, { useEffect, useState } from 'react';
import { authorize } from "../scripts.js";

function Home() {
    const [data, setData] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
            const profileData = await authorize();
            setData(profileData);
        };

        fetchData();
    }, []);

    if (!data) {
        return <div>Loading...</div>;
    }

    return (
        <div className="home">
            <h1>Display your Spotify profile data</h1>
            <section id="profile">
                <h2>Logged in as {data.displayName}</h2>
                <img src={data.profileImage} alt="Profile" />
                <ul>
                    <li>User ID: {data.id}</li>
                    <li>Email: {data.email}</li>
                </ul>
            </section>
        </div>
    );
}

export default Home;
